import React from "react";
import styled from "styled-components";

const SloganDomain = styled.div`
  width: 100%;
  height: 100%;
  background: blue;
  display: flex;
  flex-direction: column;
  align-items: center;
  h1 {
    color: black;
    font-size: 3.5rem;
    margin-top: 5rem;
    margin-bottom: 0;
  }
  p {
    color: black;
    font-size: 1.5rem;
  }
`;

function Slogan_Domain() {
  return (
    <>
      <SloganDomain>
        <h1>
          함께하고,
          <br />
          성장하는,
          <br /> 소통하는
          <br /> Endless Creation
        </h1>
        <p>
          신입 기수 모집 중 (~3/21) <br /> 31기 여러분들을 기다리고 있어요!
        </p>
      </SloganDomain>
    </>
  );
}

export default Slogan_Domain;
